import classes from './GridCategory.module.css';
import { Row, Col, Container } from 'react-bootstrap';

import slider_file_01 from '../../assets/images/slider_01.png';

function GridCategory() {
    return (

        <Container>
            <Container className={classes.GridCategoryStyle} fluid>
                <Row>
                    <Col>
                        <Row><img src={slider_file_01} fluid /></Row>
                        <Row><img src={slider_file_01} fluid /></Row>
                    </Col>

                    <Col>
                        <Col>1 of 1 </Col>
                        <Col>1 of 2 </Col>
                    </Col>
                </Row>
            </Container>
        </Container>
    )
}

export default GridCategory;
